import axios from 'axios';

export const fetchCartByUser = async (userId) => {
  try {
    const response = await axios.get('http://localhost:4000/api/cart/user', {
      params: { id_user: userId }
    });
    console.log(response.data);
    return response.data;
  } catch (e) {
    throw e;
  }
};

export const fetchCartByUserCurrent = async (userId) => {
  try {
    const response = await axios.get('http://localhost:4000/api/cart/user/current', {
      params: { id_user: userId }
    });
    console.log(response.data);
    return response.data;
  } catch (e) {
    throw e;
  }
};

export const postCart = async (userId,date,id_product) => {
  try {
    const response = await axios.post('http://localhost:4000/api/cart', {
      id_user: userId,
      date_created:date,
      id_product:id_product
    });
    console.log(response.data);
    return response.data;
  } catch (e) {
    throw e;
  }
};
